import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const hello = {
  color : "red",
  textAlign : "center"
}
const fname= "Pooja"
const lname = "Agrawal"
const currdate = new Date().toLocaleDateString();
const currtime = new Date().toLocaleTimeString();
const img1 = "https://picsum.photos/200/300"
const img2 = "https://picsum.photos/250/300"
const links = "www.google.com"

ReactDOM.render(
  <div>
    <h1 contentEditable="true" style = {hello}>Hello World {`${fname} ${lname}`} </h1>
    <p className = "datetime"> Current date is {currdate} and time is {currtime}</p>
    <ol>
      <li>Python</li>
      <li>Java</li>
      <li>C</li>
      <li>C++</li>
    </ol>
    <img src={img1} alt="rimage" />
    <img src={img2} alt="rimage" />
    <a href ={links} target="_blank">Google</a>
  </div>
  ,document.getElementById('root')

);
